var title_f34_62_35819="Characteristics streptococcal toxic shock";
var content_f34_62_35819=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ID%2F63186&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ID%2F63186&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Clinical characteristics of the toxic shock-like syndrome caused by group A streptococci",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Characteristic",
"       </td>",
"       <td class=\"subtitle1\">",
"        Comment",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Age group affected",
"       </td>",
"       <td>",
"        All ages; predominantly adults",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Sex most often affected",
"       </td>",
"       <td>",
"        No predilection",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Portal of entry",
"       </td>",
"       <td>",
"        Variable, generally skin or soft tissue (also vagina",
"and respiratory tract)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Clinical features",
"       </td>",
"       <td>",
"        Fever; hypotension; altered mental status, coma; signs",
"of soft tissue infection that usually progresses to necrotizing",
"fasciitis or myositis; active varicella with secondary infection;",
"multiorgan dysfunction, often with acute respiratory distress syndrome",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Bacteremia",
"       </td>",
"       <td>",
"        Often present (about 60 percent)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        Causative organism",
"       </td>",
"       <td class=\"sublist_other_start\">",
"        Group A streptococcus",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        M serotype",
"       </td>",
"       <td class=\"sublist_other\">",
"        Variable; 1, 3, 12, and 28 most common",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Type of pyrogenic exotoxin",
"       </td>",
"       <td class=\"sublist_other\">",
"        A, B, C, SSA, MF",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Case fatality rate, percent",
"       </td>",
"       <td>",
"        30 to 60",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
