"     <tr>",
"      <td colspan=\"1\" rowspan=\"1\">",
"       <p>",
"        American Association of Suicidology",
"       </p>",
"       <p>",
"        www.suicidology.org",
"       </p>",
"       <p>",
"        202-237-2280",
"       </p>",
"      </td>",
"      <td colspan=\"1\">",
"       Provides information on current research, prevention, ways to help a suicidal person, and surviving suicide. A list of crisis centers is also included.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td colspan=\"1\" rowspan=\"1\">",
"       <p>",
"        American Foundation for Suicide Prevention",
"       </p>",
"       <p>",
"        www.afsp.org",
"       </p>",
"       <p>",
"        888-333-AFSP (2377)",
"       </p>",
"      </td>",
"      <td colspan=\"1\">",
"       Provides research, education, and current statistics regarding suicide; links to other suicide and mental health sites are offered.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td colspan=\"1\" rowspan=\"1\">",
"       <p>",
"        American Psychiatric Association",
"       </p>",
"       <p>",
"        www.psych.org",
"       </p>",
"       <p>",
"        800-852-8330",
"       </p>",
"      </td>",
"      <td>",
"       Information and referrals to psychiatrists.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td colspan=\"1\" rowspan=\"1\">",
"       <p>",
"        Boys Town",
"       </p>",
"       <p>",
"        www.boystown.org",
"       </p>",
"       <p>",
"        800-448-3000 (crisis hotline) or 800-545-5771",
"       </p>",
"      </td>",
"      <td colspan=\"1\">",
"       Cares for troubled children - both boys and girls - and for families in crisis. Their hotline staff is trained to handle calls and questions about violence and suicide.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td colspan=\"1\" rowspan=\"1\">",
"       <p>",
"        Centers for Disease Control Center for Injury Prevention and Control, Division of Violence Prevention",
"       </p>",
"       <p>",
"        www.cdc.gov/ncipc/",
"       </p>",
"       <p>",
"        770-488-4362",
"       </p>",
"      </td>",
"      <td>",
"       Provides links to suicide statistics, the SafeUSA Web site, and safety information.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td colspan=\"1\" rowspan=\"1\">",
"       <p>",
"        National Alliance for the Mentally Ill (NAMI)",
"       </p>",
"       <p>",
"        www.nami.org",
"       </p>",
"       <p>",
"        800-950-NAMI (6264)",
"       </p>",
"      </td>",
"      <td colspan=\"1\">",
"       Provides information about family support and self-help groups, links to information about teen suicide, child suicide, brain biology and suicide, as well as general suicide information links.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td colspan=\"1\" rowspan=\"1\">",
"       <p>",
"        Depression and Bipolar Support Alliance",
"       </p>",
"       <p>",
"        www.dbsalliance.org",
"       </p>",
"       <p>",
"        800-826-3632",
"       </p>",
"      </td>",
"      <td>",
"       Provides information about mood disorders including support groups and local chapters.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td colspan=\"1\" rowspan=\"1\">",
"       <p>",
"        National Institute of Mental Health (NIMH)",
"       </p>",
"       <p>",
"        www.nimh.nih.gov",
"       </p>",
"       <p>",
"        800-421-4211",
"       </p>",
"      </td>",
"      <td colspan=\"1\">",
"       Provides information on depression and other mental illnesses.",
"      </td>",
"     </tr>",
"    </table>",
