var title_f34_62_35821="Dialysis amyloidosis in elderly";
var content_f34_62_35821=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=NEPH%2F68848&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=NEPH%2F68848&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Increased frequency of dialysis-related amyloidosis in the elderly",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 411px; height: 290px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Relative risk of radiologic signs of bone amyloidosis according to age and membrane type. The risk is increased in older patients and those treated with bioincompatible cellulosic membranes. Patients who are over age 60 at the start of dialysis have a five-fold increase in likelihood of developing bone amyloidosis if they are dialyzed with cellulosic membranes compared to high-flux biocompatible AN 69 membranes.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from van Ypersele de Strihou, C, Jadoul, M, Malghem, J, et al, Kidney Int 1991; 39:1012.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
